INSERT INTO `reviews` VALUES (1,1,1,'Interesting','Bluebeary Ale was one of the first craft beers I had ever tried. In my opinion, it is more of a summer beer as it is fruity yet refreshing. I prefer bottle over can, but I stole this from Shans beer fridge so can’t complain. Cheers',3,'2021-05-17 15:32:49','2021-05-27 22:52:58',0,1),(2,2,1,'Pleasant Surprise','Quite complex for an amber ale. Sweet malt forward... caramel with hints of chocolate, raisin and a nice biscuity malt profile. This is pretty damn good! Deep red hue and finishes smooth, begging me to take another mouthful.',3,'2021-05-17 15:32:49','2021-05-27 22:53:01',0,1),(3,3,1,'Good enough','It’s clean crisp and not as hoppy as a ipa which in my books is a good thing.',2,'2021-05-17 15:32:49','2021-05-27 22:53:04',0,1),(4,4,3,'Breath of Fresh air','Great chocolate stout. Not overpowering just richly infused.',3,'2021-05-17 15:32:49','2021-05-27 22:53:07',0,1),(5,5,5,'Smooth','Love the salty sweet flavor...smooth',3,'2021-05-17 15:32:49','2021-05-27 22:53:47',0,2),(6,6,4,'Awesome!','My fav local IPA.',4,'2021-05-17 15:32:49','2021-05-27 22:53:49',0,2),(7,7,2,'A good reliable amber','Light, short, sweet. Peanut, biscuit, a bit of raisins. Some mild hops in there.',3,'2021-05-17 15:32:49','2021-05-27 22:53:51',0,2),(8,8,1,'Great Pale Ale!','I can’t believe I’ve never checked this one in',4,'2021-05-17 15:32:49','2021-05-27 22:53:53',0,2),(9,9,3,'A true crowd pleaser','A soft, tropical, and juicy New England IPA double dry-hopped with El Dorado, Vic Secret, lupulin-enriched Mosaic & Citra.',5,'2021-05-17 15:32:49','2021-05-27 22:53:56',0,3),(10,10,2,'Easy drinkin','I just love this beer, so fresh, juiced and hopped. This was canned in Feb and still a banger in April',5,'2021-05-17 15:32:49','2021-05-27 22:53:59',0,3),(11,11,5,'Another fog machine hit','100% chance of fog on a beautiful sunny day. Nice creamy melon flavour, with the classic kilter tropical juicy flavour. Pine and lemon rounds it out.',4,'2021-05-17 15:32:49','2021-05-27 22:54:00',0,3),(12,12,1,'Refreshing!','Nice hop aroma, golden color and long lasting head. Creamy smooth slight hop bitter flavor and hints of pine finish.',4,'2021-05-17 15:32:49','2021-05-27 22:54:02',0,3),(13,13,1,'Belgian Classic','Nice clean crisp and modestly sweet with a definite malt flavour',5,'2021-05-17 15:32:49','2021-05-27 22:54:50',0,4),(14,14,2,'Honey Taste!','I really enjoyed this brew! Great work! Loved the honey taste',4,'2021-05-17 15:32:49','2021-05-27 22:55:01',0,4),(15,15,3,'Citrusy, refreshing beer','Lagery with a little bright taste',1,'2021-05-17 15:32:49','2021-05-27 22:55:05',0,4),(16,16,4,'Nice hoppy and citrus','Smooth for a heavy ipa',5,'2021-05-17 15:32:49','2021-05-27 22:55:15',0,4),(17,17,3,'Limey','Could be better',2,'2021-05-17 15:32:49','2021-05-27 22:55:25',0,5),(18,18,5,'Tastes like summer','Recommended by the savvy employee at the LC, and he did not disappoint! Great sour & sweet balance, with a delicious cranberry flavor!',2,'2021-05-17 15:32:49','2021-05-27 22:55:26',0,5),(19,19,3,'Taste of Winnipeg','Clean, light, non descript beer',3,'2021-05-17 15:32:49','2021-05-27 22:55:28',0,5),(20,20,5,'Clean, light, non descript beer','Nice warm up beer .. better choice then bud... $2 king can ....',3,'2021-05-17 15:32:49','2021-05-27 22:55:34',0,5),(24,1,6,'Changed Title','Changed Review',2,'2021-05-18 17:17:38','2021-05-27 23:04:34',1,1),(25,1,6,'Good Beer','Polar Beer',4,'2021-05-18 17:18:52','2021-05-29 14:33:49',1,1),(26,1,6,'test','test',4,'2021-05-29 22:10:28','2021-05-29 22:10:41',1,1),(27,21,6,'Test','Test',3,'2021-05-29 22:11:45','2021-05-30 23:48:36',1,1),(28,1,6,'Manny\'s favourite beer','Manny likes this beer',5,'2021-05-29 23:34:13','2021-05-29 23:34:29',1,1),(29,1,6,'Test','Test',4,'2021-05-30 16:24:24','2021-05-30 16:24:38',1,1),(30,1,6,'test','test',1,'2021-05-30 17:29:02','2021-05-30 23:55:19',1,1),(31,1,6,'test3','test',1,'2021-05-30 20:30:26','2021-05-30 23:54:15',1,1),(32,1,6,'3 star','3 star',3,'2021-05-30 20:51:11','2021-05-30 23:51:35',1,1),(33,1,6,'Test ','Test Review',1,'2021-05-30 23:55:47','2021-06-01 22:42:47',1,1),(34,1,6,'1 star','1 star',1,'2021-06-01 17:15:44','2021-06-01 22:42:46',1,1),(35,1,6,'1 star','1 star',1,'2021-06-01 17:15:55','2021-06-01 22:42:44',1,1),(36,1,6,'Test','This is a test review                                            ',5,'2021-06-02 22:07:07','2021-06-02 22:07:07',0,1),(37,1,6,'Test 2','                                                TestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTest',4,'2021-06-02 22:54:13','2021-06-02 22:54:13',0,1);
